import React from 'react';
import Todo from './Todo';

const TodoList = ({ todos, setTodos, filteredTodos, Todo, setTodo }) => {
  return (
    <div className='todo-container'>
      <ul className='todo-list'>
        {filteredTodos.map((todo) => (
          <Todo 
            setTodos={setTodos} 
            todos={todos}
            todo={todo}
            text={todo.text} 
            key={todo.id} 
            setTodo={setTodo}
            Todo={Todo}
          />
        ))}
      </ul>
    </div>

  )
}

export default TodoList
